 So, a wild level 23 Oddish will have the same moves as a wild level 31 Oddish. Furthermore, the prize money you gain from trainers also remains the same.\n\nApart from that, both the properties that are randomized and the ones that aren’t are made explicit in the image.\n\n\n\nInfo on the new input system (Anarchy)\n\nIn Anarchy, the new input system is essentially the same as the old Anarchy system. Except this time, the commands get buffered, so that all of them are registered by the game. There is also a \"Wait\" input that waits for exactly the time that is assigned to that command.\nThe command that is currently being executed is highlighted in the stream. If the chat is going too fast, the script will skip commands to keep the highlighter in the window.\n\nAdditionally, you can now post \"combos\" instead of single inputs. A combo consists of up to three inputs divided by \"+\" signs. The game reacts to a combo as if these buttons were pressed at the same time. So, \"B+Left\" would make the character run to the left. Additionally, inputs may not be repeated in a combo, so \"Left+Left\" is not a valid combo.\n\nOf course, some combos would make no sense. To cope with that, some combinations of inputs are not allowed and may not appear in the same combo. These are:\n\nLeft and Right\nUp and Down\nStart and Select\n\nAdditionally, Wait may not be combined with any input.\n\n\nInfo on the new input system (Democracy)\n\nIn Democracy, you will get to vote on what inputs are getting executed next every 30 seconds. The most popular sequence of inputs will be executed after the voting period is over.\n\nNote that it’s “sequence of inputs”, not necessarily a single input.\nIn the new Democracy system, you are no longer allowed to string inputs together à la “wait4abrightbastart”. Instead, you may only string together up to 3 inputs (no numbers) divided by commas. These are executed in order, not simultaneously, so both duplicate inputs and “opposite” inputs (see Anarchy) are allowed to occur in a single sequence.\nSo, “up,up,down” is a valid sequence.\n\nAdditionally, you may also vote for Anarchy which will make the stream switch to Anarchy if it’s the most popular command.\n\n\nHow the new timer works\n\nIn the current incarnation of the Anarchy and Democracy system, the game defaults to Anarchy.\nAn hour after Anarchy comes into effect, there is a 5-minute voting period between Anarchy and Democracy. You may vote multiple times during that period, but only your last vote counts. So, you can change your vote, but you never got more than one vote.\nIf Democracy wins the vote, the stream will remain in Democracy until there is a popular vote for Anarchy, upon which the stream will switch back and remain in Anarchy for an hour.\nAs a consequence of this, it is very easy to keep the game in Anarchy unless a large portion of players want to keep it in Democracy.\n\n\nA guide to using democracy effectively\n\nDemocracy is good for navigating tricky or dangerous areas or interfaces such as the PC, but it suffers from the effects of the stream lag. This can make it unintuitive and frustrating to use, since people’s current votes tend to take effect in the next voting round. If a significant portion of the voting population is unaware of this, it can make progressing difficult or even impossible. The solution to this is a general knowledge of the technique required to compensate for the stream lag.\n","ibi":9139},{"ty":"te","spi":9193,"id":"kix.8tg3yzfprg21"},{"ty":"as","sm":{"ls_ts":{"ts_st":false,"ts_st_i":true,"ts_it_i":true,"ts_bgc":null,"ts_va":"nor","ts_va_i":true,"ts_sc":false,"ts_fgc_i":true,"ts_ff":"Arial","ts_bd_i":true,"ts_un_i":true,"ts_ff_i":true,"ts_bgc_i":true,"ts_fs":11,"ts_it":false,"ts_sc_i":true,"ts_un":false,"ts_fgc":"#000000","ts_fs_i":true,"ts_bd":false},"ls_id":null,"ls_nest":0},"ei":9179,"st":"list","si":9179,"fm":false},{"ty":"as","sm":{"ps_hdid":"","ps_sm_i":true,"ps_awao":false,"ps_ltr":true,"ps_ls_i":false,"
